import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Updated imports for v6

import Doctor from './Doctor';
import SuccessPage from './SuccessPage'; // Import SuccessPage component

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Doctor />} /> {/* Use element prop instead of component */}
                <Route path="/success" element={<SuccessPage />} /> {/* Use element prop instead of component */}
                {/* Add more routes as needed */}
            </Routes>
        </Router>
    );
}

export default App;
